import logo from './logo.svg';
import { BrowserRouter as Routes, Route } from 'react-router-dom';
import './App.css';
import Layout from './components/Layout';

function App() {
  return (
    <>
    <Routes>
      <Route path='/' Component={Layout}/>
    </Routes>
    </>
  );
}

export default App;
